import { NavLink } from "react-router-dom";

export const Navbar = () => {
    return (
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <div>
                <NavLink to="/">
                    Home
                </NavLink>
                <NavLink to="/about">
                    Test
                </NavLink>
            </div>
        </nav>
    )
}
